import React from 'react';
import Drawer from '@mui/material/Drawer';
import List from '@mui/material/List';
import ListItem from '@mui/material/ListItem';
import ListItemButton from '@mui/material/ListItemButton';
import ListItemIcon from '@mui/material/ListItemIcon';
import ListItemText from '@mui/material/ListItemText';
import HomeIcon from '@mui/icons-material/Home';
import PeopleIcon from '@mui/icons-material/People';
import DnsRoundedIcon from '@mui/icons-material/DnsRounded';

const categories = [
  {
    id: 'Mail',
    title: 'Mail',
    subtitle: 'email@material.io',
    children: [
      { id: 'Inbox', icon: <HomeIcon />, active: true },
      { id: 'Outgoing', icon: <PeopleIcon /> },
      { id: 'Drafts', icon: <DnsRoundedIcon /> },
    ],
  },
];

const itemCategory = {
  py: 1.5,
  px: 3,
  bgcolor: '#1E88E5',
  color: '#fff',
};

export default function Navigator(props) {
  const { ...other } = props;

  return (
    <Drawer variant="permanent" {...other} sx={{ height: '50%' }}>
      <List disablePadding>
        {categories.map(({ id, title, subtitle, children }) => (
          <div key={id} style={{ width: 240 }}>
            <div style={{ ...itemCategory, textAlign: 'center' }}>
              <h3 style={{ margin: 0 }}>{title}</h3>
              <h6 style={{ margin: 0 }}>{subtitle}</h6>
            </div>
            <List>
              {children.map(({ id: childId, icon, active }) => (
                <ListItem disablePadding key={childId}>
                  <ListItemButton selected={active} sx={{ py: 2, px: 3 }}>
                    <ListItemIcon>{icon}</ListItemIcon>
                    <ListItemText>{childId}</ListItemText>
                  </ListItemButton>
                </ListItem>
              ))}
            </List>
          </div>
        ))}
      </List>
    </Drawer>
  );
}
